import {useEffect, useState} from "react";
import {useNavigate, useParams} from "react-router-dom";
import {addEmployee, getById, updateEmployee} from "./api";

const EditEmployee=() => {
    //const [employee, setEmployee] = useState({})
    const [fname, setFName] = useState("");
    const [lname, setLName] = useState("");
    const [dob, setDob] = useState("");
    const [desig, setDesig] = useState("");
    const [email, setEmail] = useState("");
    const [doj, setDoj] = useState("");
    const [dept, setDept] = useState("");

    const navigate = useNavigate();
    const params=useParams();

    useEffect(() => {
        return async ()=>{
         const result= await getById(params.id);
         //setEmployee(result);
         console.log(result)
         setFName(result.fname);
         setLName(result.lname);
         setDob(result.dob);
         setDept(result.dept);
         setEmail(result.email);
         setDoj(result.doj);
         setDesig(result.desig);
        }
    }, []);

    const onFirstNameChange = (e) => {
        setFName(e.target.value);
    };
    const onLastNameChange = (e) => {
        setLName(e.target.value);
    };
    const onDeptChange = (e) => {
        setDept(e.target.value);
    };
    const onDesigChange = (e) => {
        setDesig(e.target.value);
    };
    const onEmailChange = (e) => {
        setEmail(e.target.value);
    };
    const onDojChange = (e) => {
        setDoj(e.target.value);
    };
    const onDobChange = (e) => {
        setDob(e.target.value);
    };

    const handleUpdateEmployee = async (e) => {
        
        e.preventDefault();
        const employee = {
            fname,
            lname,
            dept,
            desig,
            email,
            doj,
            dob,
        };
        
        await updateEmployee(params.id,employee)
        console.log("Update it!!")
        navigate("/list");
    };

    return (
        <div className="container">
            <h3 className="text-success">Update Employee</h3>
            <form className="col-4">
                <div class="form-outline mb-4 form-group">
                    <input type="text" className="form-control" 
                    placeholder="First Name" onChange={onFirstNameChange} value={fname} />
                </div>
                <div clclass="form-outline mb-4 form-group">
                    <input type="text" className="form-control" 
                    placeholder="Last Name" onChange={onLastNameChange} value={lname} />
                </div>
                <div class="form-outline mb-4 form-group">                   
                    <input type="text" className="form-control" 
                    placeholder="Department" onChange={onDeptChange} value={dept} />
                </div>
                <div class="form-outline mb-4 form-group">
                    <input type="text" placeholder="Designation"
                        className="form-control" onChange={onDesigChange} value={desig}
                    />
                </div>
                <div class="form-outline mb-4 form-group">
                    <input
                        type="email" placeholder="Email Id"
                        className="form-control"
                        onChange={onEmailChange} value={email}
                    />
                </div>
                <div class="form-outline mb-4 form-group">
                    <input type="text" className="form-control" 
                    placeholder="Date Of Joining(YYYY-MM-DD)" onChange={onDojChange}  value={doj}/>
                </div>
                <div class="form-outline mb-4 form-group">
                    <input type="text" className="form-control" 
                    placeholder="Date Of Birth(YYYY-MM-DD)" onChange={onDobChange}  value={dob}/>
                </div>
                <br />
                <button className="btn btn-success" onClick={handleUpdateEmployee}>Update Employee</button>
            </form>
        </div>
    );
};

export default EditEmployee;
